CREATE TABLE pg_types2 (
  id BIGINT PRIMARY KEY,
  c_decimal DECIMAL,
  c_interval INTERVAL,
  c_date date,
  c_time time,
  c_timestamp timestamp
);

ALTER TABLE
  pg_types2 REPLICA IDENTITY FULL;

